import React, { useState } from 'react'

const Fileupload = () => {
    const [file, setFile] = useState(null)

    const uploadhandler = (e) => {
        console.log(e.target.files[0])
        setFile(e.target.files[0]);
    }
    const upload = async () => {
        const fd = new FormData();
        fd.append('file',"—Pngtree—instagram icon instagram logo_3584852.png");

        let response = await fetch(`http://localhost:8080/upload`, {
            "async": true,
            "crossDomain": true,
            method: "POST",
            "headers": {
                "cache-control": "no-cache",
                "postman-token": "2022f1f3-7f91-7565-2ba6-92019c9c22b1"
              },
            "processData": false,
            "contentType": false,
            "mimeType": "multipart/form-data",
            data: fd
        });
        let data = await response.json();
        console.log(data)
    }
    return (
        <>
            <input type={"file"} name="file" className='form-control' onChange={uploadhandler} />
            <button className='btn btn-dark' onClick={upload}>Upload</button>
        </>
    )
}

export default Fileupload
